Zoom.script:
'use strict';

/**
 * @param {Object} userProperties
 */
export function applyUserProperties(userProperties) {
	if (userProperties.cloud_depth !== undefined)
		thisObject.Zoom = .65 + userProperties.cloud_depth * .008;
}

background_color.script:
'use strict';

let custom_colors = false;
const default_color = new Vec3(0.67, 0.54, 1);
let background_color = default_color.copy();

/**
 * @param {Object} userProperties
 */
export function applyUserProperties(userProperties) {
	if (userProperties.custom_colors != undefined)
		custom_colors = userProperties.custom_colors;
	if (userProperties.schemecolor != undefined)
		background_color = userProperties.schemecolor;

	if (custom_colors)
		thisObject.background_color = background_color.copy();
	else
		thisObject.background_color = default_color.copy();
}
